const base64Data = $json.images.image_base64.replace(/^data:image\/\w+;base64,/, '');

return {
  binary: {
    data: {
      data: base64Data,
      mimeType: 'image/jpeg',
      fileName: $json.images.id || 'image.jpg',
    }
  }
};

// Group ข้อมูลทั้งหมดตาม page_id
const grouped = {};

// วนทุก item แล้วจัดกลุ่ม
for (const item of items) {
  const { page_id, content, image_name, image_url } = item.json;

  if (!grouped[page_id]) {
    // เริ่มกลุ่มใหม่
    grouped[page_id] = {
      page_id,
      content,
      image_map: {}
    };
  }

  // เพิ่ม image_name → image_url เข้า map สำหรับหน้านั้น
  grouped[page_id].image_map[image_name] = image_url;
}

// สร้างผลลัพธ์
const result = [];

for (const page of Object.values(grouped)) {
  let content = page.content;

  // สร้าง RegEx เพื่อหา ![xxx](img-xx.jpeg)
  const regex = /!\[([^\]]*?)\]\((img-\d+\.jpeg)\)/g;

  // แทนที่ทุกภาพใน content ถ้าเจอ link ที่ตรงใน image_map
  content = content.replace(regex, (match, altText, fileName) => {
    const url = page.image_map[fileName];
    if (url) {
      return `![${altText}](${url})`;
    }
    return match; // ถ้าไม่มี URL ให้คงไว้
  });

  result.push({
    json: {
      page_id: page.page_id,
      content
    }
  });
}

return result;
